import React, {useState} from 'react'
import styled from "styled-components"

const Wrapper = styled.div`
    ul{
        display: flex;
        list-style: none;
        justify-content: space-around;
        background: transparent
    }
    li{
        font-size: 25px
    }
`


function Nav() {

    const [open, setOpen] = useState(false)

    return (
      <Wrapper>
        <div>
          <ul>
            <li>Membership</li>
            <li>About</li>
            <li>Schedule</li>
            <li>WOD</li>
            <li>Rates</li>
            <li>Contact</li>
          </ul>
        </div>
      </Wrapper>
    );
}

export default Nav
